import {createRouter, createWebHistory} from 'vue-router';

import dashboardd from '@/pages/MyDashboard.vue';

const routes = [
    {
        path: '/',
        name: 'MyDashboard',
        component: dashboardd
    }
];

const router = Router();

export default router;
function Router() {
    const router = new createRouter({
        history: createWebHistory(),
        routes,
    });
    return router;
}
